import React from "react";
import "./card.styles.css";

export const Card = props => (
    <div className="card-container">
    <img
        alt="robot"
        src={`https://robohash.org/${props.robot.id}set=set2&size=120x120`}
    />
        <h2> {props.robot.name} </h2>
        <p> {props.robot.email} </p>
    </div>
);
